            '**Choose a "Callsign" for the repository.** This is a short, unique string which identifies commits elsewhere in Phabricator. For example, you might use `M` for your mobile app repository and `B` for your backend repository.\n\n**Callsigns must be UPPERCASE**, and can not be edited after the repository is created. Generally, you should choose short callsigns.' => '**Choose a "Callsign" for the repository.** This is a short, unique string which identifies commits elsewhere in Phabricator. For example, you might use `M` for your mobile app repository and `B` for your backend repository.\n\n**Callsigns must be UPPERCASE**, and can not be edited after the repository is created. Generally, you should choose short callsigns.',
            '**Choose a human-readable name for this repository**, like "CompanyName Mobile App" or "CompanyName Backend Server". You can change this later.' => '**Choose a human-readable name for this repository**, like "CompanyName Mobile App" or "CompanyName Backend Server". You can change this later.',
            '**Choose the pronoun you prefer:**' => '**Choose the pronoun you prefer:**',
            '**DarkConsole** is a developer console which can help build and debug Phabricator applications. It includes tools for understanding errors, performance, service calls, and other low-level aspects of Phabricator\'s inner workings.' => '**DarkConsole** is a developer console which can help build and debug Phabricator applications. It includes tools for understanding errors, performance, service calls, and other low-level aspects of Phabricator\'s inner workings.',
            '**JIRA Instance Name**\n\nChoose a permanent name for this instance of JIRA. Phabricator uses this name internally to keep track of this instance of JIRA, in case the URL changes later.\n\nUse lowercase letters, digits, and period. For example, `jira`, `jira.mycompany` or `jira.engineering` are reasonable names.' => '**JIRA Instance Name**\n\nChoose a permanent name for this instance of JIRA. Phabricator uses this name internally to keep track of this instance of JIRA, in case the URL changes later.\n\nUse lowercase letters, digits, and period. For example, `jira`, `jira.mycompany` or `jira.engineering` are reasonable names.',
            '**Legalpad** is a simple application for tracking signatures and legal agreements. At the moment, it is primarily intended to help open source projects keep track of Contributor License Agreements.' => '**Legalpad** is a simple application for tracking signatures and legal agreements. At the moment, it is primarily intended to help open source projects keep track of Contributor License Agreements.',
            '**NOTE**: This script will queue tasks to reparse the data. Once the tasks have been queued, you need to run Taskmaster daemons to execute them.\n\nQUEUEING TASKS (%s Commits):' => '**NOTE**: This script will queue tasks to reparse the data. Once the tasks have been queued, you need to run Taskmaster daemons to execute them.\n\nQUEUEING TASKS (%s Commits):',
            '**Step 1 of 2 - Name Phabricator OAuth Instance**\n\nChoose a permanent name for the OAuth server instance of Phabricator. //This// instance of Phabricator uses this name internally to keep track of the OAuth server instance of Phabricator, in case the URL changes later.' => '**Step 1 of 2 - Name Phabricator OAuth Instance**\n\nChoose a permanent name for the OAuth server instance of Phabricator. //This// instance of Phabricator uses this name internally to keep track of the OAuth server instance of Phabricator, in case the URL changes later.',
            '**Step 1 of 2**: Provide the name and URI for your JIRA install.\n\nIn the next step, you will configure JIRA.' => '**Step 1 of 2**: Provide the name and URI for your JIRA install.\n\nIn the next step, you will configure JIRA.',
            '**Step 2 of 2 - Configure Phabricator OAuth Instance**\n\nTo configure Phabricator OAuth, create a new application here:\n\n%s/oauthserver/client/create/\n\nWhen creating your application, use these settings:\n\n  - **Redirect URI:** Set this to: `%s`\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** to the fields above. (You may need to generate the client secret by clicking \'New Secret\' first.)' => '**Step 2 of 2 - Configure Phabricator OAuth Instance**\n\nTo configure Phabricator OAuth, create a new application here:\n\n%s/oauthserver/client/create/\n\nWhen creating your application, use these settings:\n\n  - **Redirect URI:** Set this to: `%s`\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** to the fields above. (You may need to generate the client secret by clicking \'New Secret\' first.)',
            '**Step 2 of 2**: In this step, you will configure JIRA.\n\n**Create a JIRA Application**: Log into JIRA and go to **Administration**, then **Add-ons**, then **Application Links**. Click the button labeled **Add Application Link**, and use these settings to create an application:\n\n  - **Server URL**: `%s`\n  - Then, click **Next**. On the second page:\n  - **Application Name**: `Phabricator`\n  - **Application Type**: `Generic Application`\n  - Then, click **Create**.\n\n**Configure Your Application**: Find the application you just created in the table, and click the **Configure** link under **Actions**. Select **Incoming Authentication** and click the **OAuth** tab (it may be selected by default). Then, use these settings:\n\n  - **Consumer Key**: Set this to the "Consumer Key" value in the form above.\n  - **Consumer Name**: `Phabricator`\n  - **Public Key**: Set this to the "Public Key" value in the form above.\n  - **Consumer Callback URL**: `%s`\nClick **Save** in JIRA. Authentication should now be configured, and this provider should work correctly.' => '**Step 2 of 2**: In this step, you will configure JIRA.\n\n**Create a JIRA Application**: Log into JIRA and go to **Administration**, then **Add-ons**, then **Application Links**. Click the button labeled **Add Application Link**, and use these settings to create an application:\n\n  - **Server URL**: `%s`\n  - Then, click **Next**. On the second page:\n  - **Application Name**: `Phabricator`\n  - **Application Type**: `Generic Application`\n  - Then, click **Create**.\n\n**Configure Your Application**: Find the application you just created in the table, and click the **Configure** link under **Actions**. Select **Incoming Authentication** and click the **OAuth** tab (it may be selected by default). Then, use these settings:\n\n  - **Consumer Key**: Set this to the "Consumer Key" value in the form above.\n  - **Consumer Name**: `Phabricator`\n  - **Public Key**: Set this to the "Public Key" value in the form above.\n  - **Consumer Callback URL**: `%s`\nClick **Save** in JIRA. Authentication should now be configured, and this provider should work correctly.',
            '**Storage Not Initialized**: There is no database storage initialized in this storage namespace ("%s"). Use **%s** to initialize storage.' => '**Storage Not Initialized**: There is no database storage initialized in this storage namespace ("%s"). Use **%s** to initialize storage.',
            '**Why do bot accounts need an email address?**\n\nAlthough bots do not normally receive email from Phabricator, they can interact with other systems which require an email address. Examples include:\n\n  - If the account takes actions which //send// email, we need     an address to use in the //From// header.\n  - If the account creates commits, Git and Mercurial require     an email address for authorship.\n  - If you send email //to// Phabricator on behalf of the     account, the address can identify the sender.\n  - Some internal authentication functions depend on accounts     having an email address.\n\n\nThe address will automatically be verified, so you do not need to be able to receive mail at this address, and can enter some invalid or nonexistent (but correctly formatted) address like `bot@yourcompany.com` if you prefer.' => '**Why do bot accounts need an email address?**\n\nAlthough bots do not normally receive email from Phabricator, they can interact with other systems which require an email address. Examples include:\n\n  - If the account takes actions which //send// email, we need     an address to use in the //From// header.\n  - If the account creates commits, Git and Mercurial require     an email address for authorship.\n  - If you send email //to// Phabricator on behalf of the     account, the address can identify the sender.\n  - Some internal authentication functions depend on accounts     having an email address.\n\n\nThe address will automatically be verified, so you do not need to be able to receive mail at this address, and can enter some invalid or nonexistent (but correctly formatted) address like `bot@yourcompany.com` if you prefer.',
            '**reparse** __what__ __which_parts__ [--trace] [--force]\n\nRerun the Diffusion parser on specific commits and repositories. Mostly useful for debugging changes to Diffusion.\n\ne.g. enqueue reparse owners in the TEST repo for all commits:\nrepository reparse --all TEST --owners\n\ne.g. do same but exclude before yesterday (local time):\nrepository reparse --all TEST --owners --min-date yesterday\nrepository reparse --all TEST --owners --min-date "today -1 day".\n\ne.g. do same but exclude before 03/31/2013 (local time):\nrepository reparse --all TEST --owners --min-date "03/31/2013"' => '**reparse** __what__ __which_parts__ [--trace] [--force]\n\nRerun the Diffusion parser on specific commits and repositories. Mostly useful for debugging changes to Diffusion.\n\ne.g. enqueue reparse owners in the TEST repo for all commits:\nrepository reparse --all TEST --owners\n\ne.g. do same but exclude before yesterday (local time):\nrepository reparse --all TEST --owners --min-date yesterday\nrepository reparse --all TEST --owners --min-date "today -1 day".\n\ne.g. do same but exclude before 03/31/2013 (local time):\nrepository reparse --all TEST --owners --min-date "03/31/2013"',
