            '==== Adjust Account Settings ====\n\nYou can configure settings for your account by clicking the wrench icon in the main menu bar, or visiting the **[[ %s | Settings Application ]]** directly.' => '==== Adjust Account Settings ====\n\nYou can configure settings for your account by clicking the wrench icon in the main menu bar, or visiting the **[[ %s | Settings Application ]]** directly.',
            '==== Adjust Account Settings ====\n\nYou\'ve adjusted at least one setting on your account. To make more adjustments, visit the **[[ %s | Settings Application ]]**.' => '==== Adjust Account Settings ====\n\nYou\'ve adjusted at least one setting on your account. To make more adjustments, visit the **[[ %s | Settings Application ]]**.',
            '==== Configure Phabricator Settings ====\n\nMany aspects of Phabricator are configurable. To explore and adjust settings, use the **[[ %s | Config Application ]]**.' => '==== Configure Phabricator Settings ====\n\nMany aspects of Phabricator are configurable. To explore and adjust settings, use the **[[ %s | Config Application ]]**.',
            '==== Configure Phabricator Settings ====\n\nYou\'ve configured at least one setting from the web interface. To configure more settings later, use the **[[ %s | Config Application ]]**.' => '==== Configure Phabricator Settings ====\n\nYou\'ve configured at least one setting from the web interface. To configure more settings later, use the **[[ %s | Config Application ]]**.',
            '==== Customize Home Page ====\n\nWhen you\'re done setting things up, you can create a custom dashboard and install it. Your dashboard will replace this welcome screen on the Phabricator home page. Dashboards can show users the information that\'s most important to your organization. You can configure them to display things like: a custom welcome message, a feed of recent activity, or a list of open tasks, waiting reviews, recent commits, and so on. After you install a default dashboard, it will replace this page. You can find this page later by visiting the **Config** application, under **Welcome Page**. To get started building a dashboard, use the **[[ %s | Dashboards Application ]]**. ' => '==== Customize Home Page ====\n\nWhen you\'re done setting things up, you can create a custom dashboard and install it. Your dashboard will replace this welcome screen on the Phabricator home page. Dashboards can show users the information that\'s most important to your organization. You can configure them to display things like: a custom welcome message, a feed of recent activity, or a list of open tasks, waiting reviews, recent commits, and so on. After you install a default dashboard, it will replace this page. You can find this page later by visiting the **Config** application, under **Welcome Page**. To get started building a dashboard, use the **[[ %s | Dashboards Application ]]**. ',
            '==== Customize Home Page ====\n\nYou\'ve installed a default dashboard to replace this welcome screen on the home page. You can still visit the welcome screen here at any time if you have steps you want to complete later, or if you feel lonely. If you\'ve changed your mind about the dashboard you installed, you can install a different default dashboard with the **[[ %s | Dashboards Application ]]**.' => '==== Customize Home Page ====\n\nYou\'ve installed a default dashboard to replace this welcome screen on the home page. You can still visit the welcome screen here at any time if you have steps you want to complete later, or if you feel lonely. If you\'ve changed your mind about the dashboard you installed, you can install a different default dashboard with the **[[ %s | Dashboards Application ]]**.',
            '==== Explore Applications ====\n\nPhabricator is a large suite of applications that work together to help you develop software, manage tasks, and communicate. A few of the most commonly used applications are pinned to the left navigation bar by default.\n\nTo explore all of the Phabricator applications, adjust settings, or uninstall applications you don\'t plan to use, visit the **[[ %s | Applications Application ]]**. You can also click the **Applications** button in the left navigation menu, or search for an application by name in the main menu bar. ' => '==== Explore Applications ====\n\nPhabricator is a large suite of applications that work together to help you develop software, manage tasks, and communicate. A few of the most commonly used applications are pinned to the left navigation bar by default.\n\nTo explore all of the Phabricator applications, adjust settings, or uninstall applications you don\'t plan to use, visit the **[[ %s | Applications Application ]]**. You can also click the **Applications** button in the left navigation menu, or search for an application by name in the main menu bar. ',
            '==== Install Phabricator ====\n\nYou have successfully installed Phabricator. This screen will guide you through configuration and orientation. These steps are optional, and you can go through them in any order. If you want to get back to this screen later on, you can find it in the **Config** application under **Welcome Screen**.' => '==== Install Phabricator ====\n\nYou have successfully installed Phabricator. This screen will guide you through configuration and orientation. These steps are optional, and you can go through them in any order. If you want to get back to this screen later on, you can find it in the **Config** application under **Welcome Screen**.',
            '==== Login and Registration ====\n\nYou haven\'t configured any authentication providers yet. Authentication providers allow users to register accounts and log in to Phabricator. You can configure Phabricator to accept credentials like username and password, LDAP, or Google OAuth. You can configure authentication using the **[[ %s | Auth Application ]]**.' => '==== Login and Registration ====\n\nYou haven\'t configured any authentication providers yet. Authentication providers allow users to register accounts and log in to Phabricator. You can configure Phabricator to accept credentials like username and password, LDAP, or Google OAuth. You can configure authentication using the **[[ %s | Auth Application ]]**.',
            '==== Login and Registration ====\n\nYou\'ve configured at least one authentication provider, so users can register or log in. To configure more providers or adjust settings, use the **[[ %s | Auth Application ]]**.' => '==== Login and Registration ====\n\nYou\'ve configured at least one authentication provider, so users can register or log in. To configure more providers or adjust settings, use the **[[ %s | Auth Application ]]**.',
            '==== Need Help with Setup? ====\n\nHaving trouble getting something set up? See **[[ %s | Give Feedback! Get Support! ]]** for ways to get in touch to get answers to questions, report bugs, and request features.' => '==== Need Help with Setup? ====\n\nHaving trouble getting something set up? See **[[ %s | Give Feedback! Get Support! ]]** for ways to get in touch to get answers to questions, report bugs, and request features.',
            '==== Quick Start: Bugs and Tasks ====\n\nTrack bugs and tasks in Phabricator with **[[ %s | Maniphest ]]**. Users in all roles can use Maniphest to manage current and planned work and to track bugs and issues. To get started with bugs and tasks:\n\n  - **[[ %s | Create a Task ]]**\n  - **[[ %s | View All Tasks ]]**\n' => '==== Quick Start: Bugs and Tasks ====\n\nTrack bugs and tasks in Phabricator with **[[ %s | Maniphest ]]**. Users in all roles can use Maniphest to manage current and planned work and to track bugs and issues. To get started with bugs and tasks:\n\n  - **[[ %s | Create a Task ]]**\n  - **[[ %s | View All Tasks ]]**\n',
            '==== Quick Start: Code Review ====\n\nReview code with **[[ %s | Differential ]]**. Engineers can use Differential to share, review, and approve changes to source code. To get started with code review:\n\n  - **[[ %s | Create a Revision ]]** //(Copy and paste a diff from     the command line into the web UI to quickly get a feel for     review.)//\n  - **[[ %s | View All Revisions ]]**\n\nFor more information, see these articles in the documentation:\n\n  - **[[ %s | Differential User Guide ]]**, for a general overview     of Differential.\n  - **[[ %s | User Guide: Review vs Audit ]]**, for a discussion     of different code review workflows.' => '==== Quick Start: Code Review ====\n\nReview code with **[[ %s | Differential ]]**. Engineers can use Differential to share, review, and approve changes to source code. To get started with code review:\n\n  - **[[ %s | Create a Revision ]]** //(Copy and paste a diff from     the command line into the web UI to quickly get a feel for     review.)//\n  - **[[ %s | View All Revisions ]]**\n\nFor more information, see these articles in the documentation:\n\n  - **[[ %s | Differential User Guide ]]**, for a general overview     of Differential.\n  - **[[ %s | User Guide: Review vs Audit ]]**, for a discussion     of different code review workflows.',
            '==== Quick Start: Design Review ====\n\nReview proposed designs with **[[ %s | Pholio ]]**. Designers can use Pholio to share images of what they\'re working on and show off things they\'ve made. To get started with design review:\n\n  - **[[ %s | Create a Mock ]]**\n  - **[[ %s | View All Mocks ]]**' => '==== Quick Start: Design Review ====\n\nReview proposed designs with **[[ %s | Pholio ]]**. Designers can use Pholio to share images of what they\'re working on and show off things they\'ve made. To get started with design review:\n\n  - **[[ %s | Create a Mock ]]**\n  - **[[ %s | View All Mocks ]]**',
            '==== Quick Start: Repositories ====\n\nManage and browse source code repositories with **[[ %s | Diffusion ]]**. Engineers can use Diffusion to browse and audit source code. You can configure Phabricator to host repositories, or have it track existing repositories hosted elsewhere (like GitHub, Bitbucket, or an internal server). To get started with repositories:\n\n  - **[[ %s | Create a New Repository ]]**\n  - **[[ %s | View All Repositories ]]**\n\nFor more information, see these articles in the documentation:\n\n  - **[[ %s | Diffusion User Guide ]]**, for a general overview of     Diffusion.\n  - **[[ %s | Diffusion User Guide: Repository Hosting ]]**,     for instructions on configuring repository hosting.\n\nPhabricator supports Git, Mercurial and Subversion.' => '==== Quick Start: Repositories ====\n\nManage and browse source code repositories with **[[ %s | Diffusion ]]**. Engineers can use Diffusion to browse and audit source code. You can configure Phabricator to host repositories, or have it track existing repositories hosted elsewhere (like GitHub, Bitbucket, or an internal server). To get started with repositories:\n\n  - **[[ %s | Create a New Repository ]]**\n  - **[[ %s | View All Repositories ]]**\n\nFor more information, see these articles in the documentation:\n\n  - **[[ %s | Diffusion User Guide ]]**, for a general overview of     Diffusion.\n  - **[[ %s | Diffusion User Guide: Repository Hosting ]]**,     for instructions on configuring repository hosting.\n\nPhabricator supports Git, Mercurial and Subversion.',
            '==== Resolve Setup Issues ====\n\nYou have some unresolved setup issues to take care of. Click the link in the yellow banner at the top of the screen to see them, or find them in the **Config** application under **[[ %s | Setup Issues ]]**. Although most setup issues should be resolved, sometimes an issue is not applicable to an install. If you don\'t intend to fix a setup issue (or don\'t want to fix it for now), you can use the "Ignore" action to mark it as something you don\'t plan to deal with.' => '==== Resolve Setup Issues ====\n\nYou have some unresolved setup issues to take care of. Click the link in the yellow banner at the top of the screen to see them, or find them in the **Config** application under **[[ %s | Setup Issues ]]**. Although most setup issues should be resolved, sometimes an issue is not applicable to an install. If you don\'t intend to fix a setup issue (or don\'t want to fix it for now), you can use the "Ignore" action to mark it as something you don\'t plan to deal with.',
            '==== Resolve Setup Issues ====\n\nYou\'ve resolved (or ignored) all outstanding setup issues. You can review issues in the **Config** application, under **[[ %s | Setup Issues ]]**.' => '==== Resolve Setup Issues ====\n\nYou\'ve resolved (or ignored) all outstanding setup issues. You can review issues in the **Config** application, under **[[ %s | Setup Issues ]]**.',
