            'If everything looks good, click **Send Invitations** to deliver email invitations these users. Otherwise, edit the email list or personal message at the bottom of the page to revise the invitations.' => 'If everything looks good, click **Send Invitations** to deliver email invitations these users. Otherwise, edit the email list or personal message at the bottom of the page to revise the invitations.',
            'If inbound email is configured, users can interact with revisions by using "!actions" in email replies (for example, "!resign" or "!rethink"). However, by default, users may not "!accept" revisions via email: email authentication can be configured to be very weak, and email "!accept" is kind of sketchy and implies the revision may not actually be receiving thorough review. You can enable "!accept" by setting this option to true.' => 'If inbound email is configured, users can interact with revisions by using "!actions" in email replies (for example, "!resign" or "!rethink"). However, by default, users may not "!accept" revisions via email: email authentication can be configured to be very weak, and email "!accept" is kind of sketchy and implies the revision may not actually be receiving thorough review. You can enable "!accept" by setting this option to true.',
            'If no rules match, %s all other users.' => 'If no rules match, %s all other users.',
            'If the web server responds to both HTTP and HTTPS requests but you want users to connect with only HTTPS, you can set this to true to make Phabricator redirect HTTP requests to HTTPS.\n\nNormally, you should just configure your server not to accept HTTP traffic, but this setting may be useful if you originally used HTTP and have now switched to HTTPS but don\'t want to break old links, or if your webserver sits behind a load balancer which terminates HTTPS connections and you can not reasonably configure more granular behavior there.\n\nIMPORTANT: Phabricator determines if a request is HTTPS or not by examining the PHP `%s` variable. If you run Apache/mod_php this will probably be set correctly for you automatically, but if you run Phabricator as CGI/FCGI (e.g., through nginx or lighttpd), you need to configure your web server so that it passes the value correctly based on the connection type.' => 'If the web server responds to both HTTP and HTTPS requests but you want users to connect with only HTTPS, you can set this to true to make Phabricator redirect HTTP requests to HTTPS.\n\nNormally, you should just configure your server not to accept HTTP traffic, but this setting may be useful if you originally used HTTP and have now switched to HTTPS but don\'t want to break old links, or if your webserver sits behind a load balancer which terminates HTTPS connections and you can not reasonably configure more granular behavior there.\n\nIMPORTANT: Phabricator determines if a request is HTTPS or not by examining the PHP `%s` variable. If you run Apache/mod_php this will probably be set correctly for you automatically, but if you run Phabricator as CGI/FCGI (e.g., through nginx or lighttpd), you need to configure your web server so that it passes the value correctly based on the connection type.',
            'If this user interacted with anything, it is generally better to disable them, not delete them. If you delete them, it will no longer be possible to (for example) search for objects they created, and you will lose other information about their history. Disabling them instead will prevent them from logging in, but will not destroy any of their data.' => 'If this user interacted with anything, it is generally better to disable them, not delete them. If you delete them, it will no longer be possible to (for example) search for objects they created, and you will lose other information about their history. Disabling them instead will prevent them from logging in, but will not destroy any of their data.',
            'If those commands don\'t work, try Google. The process of installing PHP extensions is not specific to Phabricator, and any instructions you can find for installing them on your system should work. On Mac OS X, you might want to try Homebrew.' => 'If those commands don\'t work, try Google. The process of installing PHP extensions is not specific to Phabricator, and any instructions you can find for installing them on your system should work. On Mac OS X, you might want to try Homebrew.',
            'If true, email addresses must be verified (by clicking a link in an email) before a user can login. By default, verification is optional unless {{auth.email-domains}} is nonempty.' => 'If true, email addresses must be verified (by clicking a link in an email) before a user can login. By default, verification is optional unless {{auth.email-domains}} is nonempty.',
            'If updating generates tasks, queue them for the daemons instead of executing them in this process.' => 'If updating generates tasks, queue them for the daemons instead of executing them in this process.',
            'If you accept Phabricator SSH traffic on a different host from web traffic (for example, if you use different SSH and web load balancers), you can set the SSH hostname here. This is an advanced option.' => 'If you accept Phabricator SSH traffic on a different host from web traffic (for example, if you use different SSH and web load balancers), you can set the SSH hostname here. This is an advanced option.',
            'If you activate this space, you will be able to create objects inside it again.' => 'If you activate this space, you will be able to create objects inside it again.',
