            'If you set this to a list of HTTP URIs, when a feed story is published a task will be created for each URI that posts the story data to the URI. Daemons automagically retry failures 100 times, waiting `$fail_count * 60s` between each subsequent failure. Be sure to keep the daemon console (`%s`) open while developing and testing your end points. You may need torestart your daemons to start sending HTTP requests.\n\nNOTE: URIs are not validated, the URI must return HTTP status 200 within 30 seconds, and no permission checks are performed.' => 'If you set this to a list of HTTP URIs, when a feed story is published a task will be created for each URI that posts the story data to the URI. Daemons automagically retry failures 100 times, waiting `$fail_count * 60s` between each subsequent failure. Be sure to keep the daemon console (`%s`) open while developing and testing your end points. You may need torestart your daemons to start sending HTTP requests.\n\nNOTE: URIs are not validated, the URI must return HTTP status 200 within 30 seconds, and no permission checks are performed.',
            'If you set this to true, Phabricator will attach patches to Differential mail (as text attachments). This will not work if you are using SendGrid as your mail adapter.' => 'If you set this to true, Phabricator will attach patches to Differential mail (as text attachments). This will not work if you are using SendGrid as your mail adapter.',
            'If you set this to true, any user can abandon any revision. If false, only the submitter can abandon a revision.' => 'If you set this to true, any user can abandon any revision. If false, only the submitter can abandon a revision.',
            'If you set this to true, any user can close any revision so long as it has been accepted. This can be useful depending on your development model. For example, github-style pull requests where the reviewer is often the actual committer can benefit from turning this option to true. If false, only the submitter can close a revision.' => 'If you set this to true, any user can close any revision so long as it has been accepted. This can be useful depending on your development model. For example, github-style pull requests where the reviewer is often the actual committer can benefit from turning this option to true. If false, only the submitter can close a revision.',
            'If you set this to true, any user can reopen a revision so long as it has been closed. This can be useful if a revision is accidentally closed or if a developer changes his or her mind after closing a revision. If it is false, reopening is not allowed.' => 'If you set this to true, any user can reopen a revision so long as it has been closed. This can be useful if a revision is accidentally closed or if a developer changes his or her mind after closing a revision. If it is false, reopening is not allowed.',
