            'Phabricator can highlight PHP by default and use Pygments for other languages if enabled. You can provide a custom highlighter engine by extending class %s.' => 'Phabricator can highlight PHP by default and use Pygments for other languages if enabled. You can provide a custom highlighter engine by extending class %s.',
            'Phabricator can highlight a few languages by default, but installing and enabling Pygments (a third-party highlighting tool) will add syntax highlighting for many more languages. \n\nFor instructions on installing and enabling Pygments, see the %s configuration option.\n\nIf you do not want to install Pygments, you can ignore this issue.' => 'Phabricator can highlight a few languages by default, but installing and enabling Pygments (a third-party highlighting tool) will add syntax highlighting for many more languages. \n\nFor instructions on installing and enabling Pygments, see the %s configuration option.\n\nIf you do not want to install Pygments, you can ignore this issue.',
            'Phabricator can host repositories, or it can track repositories hosted elsewhere (like on GitHub or Bitbucket). For information on configuring hosting, see [[ %s | Diffusion User Guide: Repository Hosting]]' => 'Phabricator can host repositories, or it can track repositories hosted elsewhere (like on GitHub or Bitbucket). For information on configuring hosting, see [[ %s | Diffusion User Guide: Repository Hosting]]',
            'Phabricator can not process this mail because no application knows how to handle it. Check that the address you sent it to is correct.\n\n(No concrete, enabled subclass of PhabricatorMailReceiver can accept this mail.)' => 'Phabricator can not process this mail because no application knows how to handle it. Check that the address you sent it to is correct.\n\n(No concrete, enabled subclass of PhabricatorMailReceiver can accept this mail.)',
            'Phabricator can serve repositories over HTTP, using HTTP basic auth.\n\nBecause HTTP basic auth is less secure than SSH auth, it is disabled by default. You can enable it here if you\'d like to use it anyway. There\'s nothing fundamentally insecure about it as long as Phabricator uses HTTPS, but it presents a much lower barrier to attackers than SSH does.\n\nConsider using SSH for authenticated access to repositories instead of HTTP.' => 'Phabricator can serve repositories over HTTP, using HTTP basic auth.\n\nBecause HTTP basic auth is less secure than SSH auth, it is disabled by default. You can enable it here if you\'d like to use it anyway. There\'s nothing fundamentally insecure about it as long as Phabricator uses HTTPS, but it presents a much lower barrier to attackers than SSH does.\n\nConsider using SSH for authenticated access to repositories instead of HTTP.',
            'Phabricator can serve repositories over various protocols. You can configure server protocols here.' => 'Phabricator can serve repositories over various protocols. You can configure server protocols here.',
            'Phabricator can use less-secure but mailing list friendly public reply addresses.' => 'Phabricator can use less-secure but mailing list friendly public reply addresses.',
            'Phabricator chooses which database to connect to through a swappable configuration provider. You almost certainly do not need to change this.' => 'Phabricator chooses which database to connect to through a swappable configuration provider. You almost certainly do not need to change this.',
            'Phabricator connects to MySQL through a swappable abstraction layer. You can choose an alternate implementation by setting this option. To provide your own implementation, extend `%s`. It is very unlikely that you need to change this.' => 'Phabricator connects to MySQL through a swappable abstraction layer. You can choose an alternate implementation by setting this option. To provide your own implementation, extend `%s`. It is very unlikely that you need to change this.',
            'Phabricator does not currently support HTTP access to Subversion repositories.' => 'Phabricator does not currently support HTTP access to Subversion repositories.',
            'Phabricator does not support HTTP access to Subversion repositories.' => 'Phabricator does not support HTTP access to Subversion repositories.',
            'Phabricator has %s available in %s, but the binary exited with an error code when run as %s. Check that it is installed correctly.' => 'Phabricator has %s available in %s, but the binary exited with an error code when run as %s. Check that it is installed correctly.',
            'Phabricator has application policies which can dictate whether users can take certain actions, such as creating new users. \n\nThis setting allows for "locking" these policies such that no further edits can be made on a per-policy basis.' => 'Phabricator has application policies which can dictate whether users can take certain actions, such as creating new users. \n\nThis setting allows for "locking" these policies such that no further edits can be made on a per-policy basis.',
            'Phabricator instance name is required.' => 'Phabricator instance name is required.',
            'Phabricator instance name must contain only lowercase letters, digits, and periods.' => 'Phabricator instance name must contain only lowercase letters, digits, and periods.',
            'Phabricator is also not configured to allow unknown external users to send mail to the system using just an email address.' => 'Phabricator is also not configured to allow unknown external users to send mail to the system using just an email address.',
            'Phabricator is configured in cluster mode and the address this request was received on ("%s") is not whitelisted as a cluster address.' => 'Phabricator is configured in cluster mode and the address this request was received on ("%s") is not whitelisted as a cluster address.',
            'Phabricator is configured to authenticate users using the "Reply-To" header, but the reply address ("%s") on this message does not correspond to any known user account.' => 'Phabricator is configured to authenticate users using the "Reply-To" header, but the reply address ("%s") on this message does not correspond to any known user account.',
            'Phabricator is configured to operate in cluster mode, but %s is not defined in the request context. Your webserver configuration needs to forward %s to PHP so Phabricator can reject requests received on external interfaces.' => 'Phabricator is configured to operate in cluster mode, but %s is not defined in the request context. Your webserver configuration needs to forward %s to PHP so Phabricator can reject requests received on external interfaces.',
            'Phabricator is configured to use a notification server, but is unable to connect to it. You should resolve this issue or disable the notification server. It may be helpful to double check your configuration or restart the server using the command below.\n\n%s' => 'Phabricator is configured to use a notification server, but is unable to connect to it. You should resolve this issue or disable the notification server. It may be helpful to double check your configuration or restart the server using the command below.\n\n%s',
            'Phabricator is currently configured to serve user uploads directly from the same domain as other content. This is a security risk.\n\nConfigure a CDN (or alternate file domain) to eliminate this risk. Using a CDN will also improve performance. See the guide below for instructions.' => 'Phabricator is currently configured to serve user uploads directly from the same domain as other content. This is a security risk.\n\nConfigure a CDN (or alternate file domain) to eliminate this risk. Using a CDN will also improve performance. See the guide below for instructions.',
            'Phabricator is misconfigured, the application email \'%s\' is set to user \'%s\' but that user does not exist.' => 'Phabricator is misconfigured, the application email \'%s\' is set to user \'%s\' but that user does not exist.',
            'Phabricator is not able to process this mail because more than one application is willing to accept it, creating ambiguity. Mail needs to be accepted by exactly one receiving application.\n\nAccepting receivers: %s.' => 'Phabricator is not able to process this mail because more than one application is willing to accept it, creating ambiguity. Mail needs to be accepted by exactly one receiving application.\n\nAccepting receivers: %s.',
            'Phabricator is not configured to serve cluster requests. Set `cluster.addresses` in the configuration to whitelist cluster hosts before sending requests that use a cluster authentication mechanism.' => 'Phabricator is not configured to serve cluster requests. Set `cluster.addresses` in the configuration to whitelist cluster hosts before sending requests that use a cluster authentication mechanism.',
            'Phabricator is not currently configured to accept inbound mail. You won\'t be able to interact with objects over email until inbound mail is set up.' => 'Phabricator is not currently configured to accept inbound mail. You won\'t be able to interact with objects over email until inbound mail is set up.',
            'Phabricator is running in silent mode, so changes will not be pushed to mirrors.' => 'Phabricator is running in silent mode, so changes will not be pushed to mirrors.',
            'Phabricator is running in silent mode.' => 'Phabricator is running in silent mode.',
