            'To allow Phabricator nodes to communicate with other nodes in the cluster, provide an address whitelist of hosts that are part of the cluster.\n\nHosts on this whitelist are permitted to use special cluster mechanisms to authenticate requests. By default, these mechanisms are disabled.\n\nDefine a list of CIDR blocks which whitelist all hosts in the cluster. See the examples below for details.' => 'To allow Phabricator nodes to communicate with other nodes in the cluster, provide an address whitelist of hosts that are part of the cluster.\n\nHosts on this whitelist are permitted to use special cluster mechanisms to authenticate requests. By default, these mechanisms are disabled.\n\nDefine a list of CIDR blocks which whitelist all hosts in the cluster. See the examples below for details.',
            'To assign a task to another user, provide their username. For example, to assign a task to `%s`, write `%s`.\n\nIf you omit the username or the username is not valid, this behaves like `%s` and assigns the task to you instead.' => 'To assign a task to another user, provide their username. For example, to assign a task to `%s`, write `%s`.\n\nIf you omit the username or the username is not valid, this behaves like `%s` and assigns the task to you instead.',
            'To avoid this error, use %s to construct forms. If you are already using %s, make sure the form \'action\' uses a relative URI (i.e., begins with a \'%s\'). Forms using absolute URIs do not include CSRF tokens, to prevent leaking tokens to external sites.\n\nIf this page performs writes which do not require CSRF protection (usually, filling caches or logging), you can use %s to temporarily bypass CSRF protection while writing. You should use this only for writes which can not be protected with normal CSRF mechanisms.\n\nSome UI elements (like %s) also have methods which will allow you to render links as forms (like %s).' => 'To avoid this error, use %s to construct forms. If you are already using %s, make sure the form \'action\' uses a relative URI (i.e., begins with a \'%s\'). Forms using absolute URIs do not include CSRF tokens, to prevent leaking tokens to external sites.\n\nIf this page performs writes which do not require CSRF protection (usually, filling caches or logging), you can use %s to temporarily bypass CSRF protection while writing. You should use this only for writes which can not be protected with normal CSRF mechanisms.\n\nSome UI elements (like %s) also have methods which will allow you to render links as forms (like %s).',
